r, Authy and more</li>\r\n</ul>\";s:7:\"excerpt\";s:65:\"Allow users to enable two-factor authentication on their account.\";s:9:\"thumbnail\";s:56:\"https://thememylogin.com/app/uploads/edd/2018/07/2fa.png\";s:8:\"category\";b:0;s:4:\"tags\";b:0;}s:7:\"pricing\";O:8:\"stdClass\":3:{s:10:\"singlesite\";s:5:\"10.00\";s:8:\"2-5sites\";s:5:\"25.00\";s:14:\"unlimitedsites\";s:5:\"40.00\";}s:9:\"licensing\";O:8:\"stdClass\":4:{s:7:\"enabled\";b:1;s:7:\"version\";s:3:\"1.0\";s:8:\"exp_unit\";s:5:\"years\";s:10:\"exp_length\";s:1:\"1\";}}i:4;O:8:\"stdClass\":3:{s:4:\"info\";O:8:\"stdClass\":12:{s:2:\"id\";i:103;s:4:\"slug\";s:12:\"restrictions\";s:5:\"title\";s:12:\"Restrictions\";s:11:\"create_date\";s:19:\"2018-06-01 15:07:21\";s:13:\"modified_date\";s:19:\"2018-09-13 13:19:21\";s:6:\"status\";s:7:\"publish\";s:4:\"link\";s:49:\"https://thememylogin.com/extensions/restrictions/\";s:7:\"content\";s:915:\"With the Restrictions extension, you can restrict your entire site, or pieces of it in a highly configurable way.\r\n<h5>Features</h5>\r\n<ul>\r\n 	<li>Restrict entire site from unauthenticated users</li>\r\n 	<li>Require users to be logged in to view specific posts or pages</li>\r\n 	<li>Require specific roles to view specific posts or pages</li>\r\n 	<li>Configure nav menu items to display only if a user is logged or not logged in</li>\r\n 	<li>Configure nav menu items to display only for specified user roles</li>\r\n 	<li>Configure widgets to display only if a user is logged or not logged in</li>\r\n 	<li>Configure widgets to display only for specified user roles</li>\r\n 	<li>Use the `[tml-require-role]` shortcode to restrict content within a post or page to a specific role</li>\r\n 	<li>Use the `[tml-require-user]` shortcode to restrict content within a post or page to a specific user or all logged in users</li>\r\n</ul>\";s:7:\"excerpt\";s:78:\"Restrict posts, pages, pieces of content and menu items by user role and more.\";s:9:\"thumbnail\";s:65:\"https://thememylo