p-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"http://localhost/wordpress/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->','Sample Page','','inherit','closed','closed','','2-revision-v1','','','2019-09-08 08:24:46','2019-09-08 08:24:46','',2,'http://localhost/wordpress/index.php/2019/09/08/2-revision-v1/',0,'revision','',0),(24,1,'2019-09-08 08:27:37','2019-09-08 08:27:37','<!-- wp:image {\"align\":\"full\"} -->\n<figure class=\"wp-block-image alignfull\"><img src=\"data:image/jpeg;base64,\" alt=\"\"/></figure>\n<!-- /wp:image -->','Women','','trash','closed','closed','','women__trashed','','','2019-09-09 07:43:53','2019-09-09 07:43:53','',0,'http://localhost/wordpress/?page_id=24',0,'page','',0),(25,1,'2019-09-08 08:27:37','2019-09-08 08:27:37','','Men','','trash','closed','closed','','men__trashed','','','2019-09-09 07:43:58','2019-09-09 07:43:58','',0,'http://localhost/wordpress/?page_id=25',0,'page','',0),(26,1,'2019-09-08 08:27:37','2019-09-08 08:27:37','','Kids','','trash','closed','closed','','kids__trashed','','','2019-09-09 07:44:00','2019-09-09 07:44:00','',0,'http://localhost/wordpress/?page_id=26',0,'page','',0),(27,1,'2019-09-08 08:27:37','2019-09-08 08:27:37','{\n    \"modul-r